import axios from 'axios'

interface IdefaultUserValues {
    name: String
    portfolio: {
        fiat: Number,
        btc: Number,
        eth: Number
    },
    trades: [] | null
}

export const resetUser = async (name: string, portfolio: object, trades: [] | null): Promise<any> => {
    await axios.post(`${process.env.REACT_APP_ENDPOINT}/API/updateUser`, {name, portfolio, trades})
    .then(data => data.data)
}
